    false,nt"url": null,nt"notes": "Volunteers worked with staff to map and
    control invasive species within the Willamette Valley National Wildlife Refuge Complex
    refuges (William L. Finley, Ankeny, and Baskett Slough). 75 % of the mature tansey
    ragwort plants were removed prior to seed dispersal 45 miles of roadsides/trails
    were mechanically/chemically/hand treated for multiple invasive species Meadow knapweed
    chemical treatments were considered 80% effective False brome was almost eradicated
    but most importantly prevented from spreading Oxeye daisy hand pulling prevented
    spread but was ineffective as eradication Hand pulling English ivy 95% eradication
